import React from "react";
import "./chatbot.css";
const chatbot = () => {
  return (
    <div className="page">
      <div className="chatbot__header">
        <h2>Chatbot</h2>
      </div>
      <h2 className="pageTitle">Welcome to Chatbot</h2>
      
  </div>);
};

export default chatbot;
